import { useState } from "react";

const Note = ({ note }) => {
  const [showAll, setShowAll] = useState(false);
  return (
    <div>
      <p>{`${note.title} By: ${note.author}`}</p>
      {showAll && (
        <div>
          <p>{note.url}</p>
          <p>{note.likes}</p>
          <p>{note.user.username}</p>
        </div>
      )}
      <button onClick={() => setShowAll(true)}>view</button>
    </div>
  );
};

export default Note;
